0サーキット走行のマストアイテム！車輌接合部分は、ＪＩＳ規格のステンレス素材を削り出して製作しています。シャックルとの接合部分やシャフト部分のボルトも国産ステンレスボルトを使用。精度・材質・クオリティにこだわった日本製です。<br><br>シャックル部は可動式で、折りたためる構造になっています。六角レンチでボルトを締めると固定できますので、シャックル部がボディーに接触する心配もありません。サーキットでのコースアウトやトラブルの際に、スムーズに牽引することができます。また、ストリートではワンポイントのアクセサリーとなり、レーシーな雰囲気を醸し出します。<br><br>■カラー：フラットシルバー　■シャックル内径：50パイ　■メイドインジャパン　■オリジナルで製作することも可能ですので、お気軽にご相談ください。<br><br>対応車種：11- ルノー メガーヌ ＲＳ<br><br><br><br>ボディパーツ | ボディパーツその他<tr><td colspan="2">
